pragma solidity ^0.5.4;


import "./Proxy.sol";

contract Multisig {

  mapping(address => bool) public is_owner;
  uint256 public number_of_owners;
  // Required signatures apart from the sender's.
  uint256 public required_extra_signatures;
  // Unique transaction ids. If the id is already used, the transaction is reverted.
  mapping(uint256 => bool) public is_used_tx_id;

  event CallSuccessful(bytes data, address destination, uint256 indexed tx_id);
  event CallUnsuccessful(bytes data, address destination, uint256 indexed tx_id);
  event AddedOwner(address new_owner);
  event RemovedOwner(address removed_owner);
  event ChangedRequiredExtraSignatures(uint256 new_extra_signatures_requirement);
  event DeployedNewProxy(address newProxy);
  /**
   * @param owners Array of addresses that act as signers of the multisig.
   * @param initial_required_extra_signatures The amount of offline signatures needed apart from the sender.
   */
  constructor(address[] memory owners, uint256 initial_required_extra_signatures) public {
    require(owners.length > 0, "At least one owner is necessary for the multisig to work.");
    require(initial_required_extra_signatures < owners.length, "Requiring more signatures than owners would deadlock the multisig.");

    for (uint256 i = 0; i < owners.length; i++) {
      addOwnerInternal(owners[i]);
    }

    required_extra_signatures = initial_required_extra_signatures;
  }

  /**
   * @notice Call another contract with specific call data. All needed signatures should be provided.
             The call will be resolved in the same transaction. The message sender is counted as a signer.
   * @param data Call data that may be interpreted by the destination contract
   * @param destination Address that will be called by the multisig
   * @param tx_id An ID that is ensured to be unique among calls made by the multisig. It can be used to avoid repeating certain calls.
   * @param sig_v Array of one of the components of the payload signatures
   * @param sig_r Array of one of the components of the payload signatures
   * @param sig_s Array of one of the components of the payload signatures
   */
  function callAddress(bytes memory data, address destination, uint256 tx_id, uint8[] memory sig_v,
                       bytes32[] memory sig_r, bytes32[] memory sig_s) public {
    require(!is_used_tx_id[tx_id], "Transaction ID already used");
    verifySignatures(data, destination, tx_id, sig_v, sig_r, sig_s);
    is_used_tx_id[tx_id] = true;

    (bool success, ) = destination.call(data);
    if (success) {
      emit CallSuccessful(data, destination, tx_id);
    }
    else {
      emit CallUnsuccessful(data, destination, tx_id);
    }
  }

  function deploy(address implementation, bytes calldata initialize_data) external onlyMultisig {
    Proxy proxied_contract = new Proxy(implementation, initialize_data);
    emit DeployedNewProxy(address(proxied_contract));
  }

  function addOwner(address new_owner) external onlyMultisig {
    addOwnerInternal(new_owner);
  }

  function addOwnerInternal(address new_owner) internal {
    require(new_owner != address(0), "The new owner should be a non-zero address");
    require(!is_owner[new_owner], "The address is already an owner of the multisig.");

    is_owner[new_owner] = true;
    number_of_owners += 1;
    emit AddedOwner(new_owner);
  }

  function removeOwner(address owner) external onlyMultisig {
    require(is_owner[owner], "The address should be an owner of the multisig.");
    require(number_of_owners > required_extra_signatures + 1, "Cannot reduce owners below the amount of necessary signatures");

    is_owner[owner] = false;
    number_of_owners -= 1;
    emit RemovedOwner(owner);
  }

  function changeRequiredExtraSignatures(uint256 new_requirement) external onlyMultisig {
    require(new_requirement < number_of_owners, "The new signature requirement should be satisfiable by the current owners.");

    required_extra_signatures = new_requirement;
    emit ChangedRequiredExtraSignatures(new_requirement);
  }

  /**
   * The multisig doesn't currently support operations with ether.
   * This allows transferral of any ether funds that happen to arrive in the contract.
   */
  function transferEther(uint256 value, address payable destination) external onlyMultisig {
    require(destination != address(0), "The destination should be a non-zero address");

    destination.transfer(value);
  }

  function verifySignatures(bytes memory data, address destination, uint256 tx_id, uint8[] memory v,
                            bytes32[] memory r, bytes32[] memory s) private view {
    require(is_owner[msg.sender], "The sender is not an owner of the multisig");
    require(v.length == r.length && r.length == s.length, "Inconsistent signature data.");
    require(v.length >= required_extra_signatures, "Amount of required signatures is not satisfied by received signatures.");

    address[] memory verified_signers = new address[](v.length + 1);
    verified_signers[0] = msg.sender;
    bytes32 message_hash = keccak256(abi.encodePacked(msg.sender, data, destination, tx_id, address(this)));

    // Valid indices for verified_signers: [0, i]
    for (uint256 i = 0; i < v.length; i++) {
      address signer = ecrecover(message_hash, v[i], r[i], s[i]);
      require(is_owner[signer], "One signer is not an owner.");

      // This algorithm doesn't scale well but since the amount of signers isn't typically high
      //  it shouldn't be a problem.
      // With Constantinople, it may be viable to use a mapping if it is cleaned at the end of this function
      //  thanks to lower gas costs for temporal usage of storage.
      for (uint256 j = 0; j <= i; j++) {
        require(verified_signers[j] != signer, "No repeated signatures are allowed.");
      }
      verified_signers[i + 1] = signer;
    }
  }

  /**
   * @notice This modifier restricts functions to be called by the multisig itself.
   * This means that the function call should be encoded and
   * passed as argument to the callAddress function as well as the multisig address.
   */
  modifier onlyMultisig() {
    require(msg.sender == address(this), "Only the multisig can call this function.");
    _;
  }

}

